INSERT INTO `settings` VALUES (1,'site_title','SmartTaxi'),(2,'site_logo',''),(3,'site_email_logo','http://localhost/logo-white.png'),(4,'site_icon','http://localhost:8000/uploads/e31cf1f921995ab3e715b812f6717e51319b834b.jpg'),(5,'site_copyright','SMARTTAXI©2020 AAPBD'),(8,'base_price','50'),(9,'price_per_minute','50'),(10,'tax_percentage','10'),(11,'stripe_secret_key','sk_test_L2X0rCUJZnmssC0bkeSSWlK4'),(12,'stripe_publishable_key','pk_test_DbfzA8Pv1MDErUiHakK9XfLe'),(13,'CASH','1'),(14,'CARD','1'),(15,'manual_request','0'),(16,'default_lang','en'),(17,'currency','$'),(19,'scheduled_cancel_time_exceed','10'),(20,'price_per_kilometer','10'),(21,'commission_percentage','10'),(24,'daily_target','10'),(25,'surge_percentage','5'),(26,'surge_trigger','5'),(27,'demo_mode','0'),(28,'booking_prefix','SMRT'),(37,'fleet_commission_percentage','0'),(38,'per_page','10'),(39,'provider_commission_percentage','0'),(40,'page_privacy','<p><strong>Sha Drive Privacy Policy </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Here at Sha Drive we want to be open and truthful about what happens with any of your personal information that you entrust with us.</p>\r\n\r\n<p>This statement describes how Sha Drive collects and uses personal data. This applies to anyone who makes use of our app, website or other features. This especially applies to any of our drivers or riders.</p>\r\n\r\n<p>Our data practices are subject to, and adherent to the law of Bangladesh.</p>\r\n\r\n<p>Anyone to whom uses our services will be referred to as the &lsquo;Customer&rsquo; in this document.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How we collect data</strong></p>\r\n\r\n<ul>\r\n	<li>When a Customer creates a profile on our app or website this information is collected by Sha Drive. This may include their name, email, phone number, login name and password, address, profile picture, payment or banking information.</li>\r\n	<li>When the Customer updates their account this information is collected by Sha Drive. This may include their name, email, phone number, login name and password, address, profile picture, payment or banking information.</li>\r\n	<li>When a driver is with us we conduct background and Identity checks and will collect this information. This may include information such as driver history or criminal record and right to work.</li>\r\n	<li>We may collect data about the device the Customer uses when obtaining our services, including device IP address, preferred languages and mobile network data.</li>\r\n	<li>We may collect precise or approximate location data from a Customer&rsquo;s mobile device</li>\r\n	<li>When a Customer places feedback, complaints and compliments or carries out a survey.</li>\r\n	<li>When a Customer takes part in a referral scheme, the details of the referred person&rsquo;s information. This may include their name, email and phone number.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How we use the data</strong></p>\r\n\r\n<p>We use the information to improve the service we provide to the Customer as well as allowing the Customer to amend and customise their experience.</p>\r\n\r\n<p>This includes using the data in the following ways:</p>\r\n\r\n<ul>\r\n	<li>Create and updating Customer accounts.</li>\r\n	<li>Verify drivers&rsquo; identity, background history, and eligibility to work.</li>\r\n	<li>Enable transportation.</li>\r\n	<li>Processing payments for our services.</li>\r\n	<li>Generate invoicing in connection with our services.</li>\r\n	<li>Using personal information to combat fraud. This may include the Customers name, email, phone number, address, profile picture, payment or banking information, mobile information and location.</li>\r\n	<li>Checking and validating drivers, including through background checks, to help prevent any unsafe riding experiences by the drivers.</li>\r\n	<li>To enable communication between driver and rider, for example the driver is able to call or text the rider if unable to find their pick up location or a personal belonging has been left in the vehicle.</li>\r\n	<li>For promotional and marketing purposes we may use the data we collect to contact Customers. This includes sending users&rsquo; communication about services, features, promotions, surveys, news and updates.</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n'),(41,'broadcast_request','1'),(42,'track_distance','1'),(43,'stripe_oauth_url','https://dashboard.stripe.com/oauth/authorize?response_type=code&client_id=ca_DfAxAmQmfhUHUhlvcnTzSmGdMAtgBVXH&scope=read_write'),(45,'help','<h1>&nbsp;</h1>\r\n\r\n<p>Updating.............</p>\r\n'),(46,'terms','<p>Updating.............</p>\r\n'),(54,'version_ios_user',''),(55,'version_ios_provider',''),(56,'version_android_user',''),(57,'version_android_provider',''),(58,'send_email','0'),(70,'referral_amount','50'),(71,'referral_count','10'),(72,'referral','1'),(73,'map_key','AIzaSyD_tBDMhNHreNgXWjY4OCF5-9ow7-5ACXY'),(74,'provider_select_timeout','60'),(75,'provider_search_radius','100'),(77,'fb_app_version','v1'),(78,'fb_app_id','123'),(79,'fb_app_secret','123'),(81,'mail_driver',''),(82,'mail_host',''),(83,'mail_username',''),(84,'mail_password',''),(85,'mail_from_address',''),(86,'mail_port',''),(87,'mail_encryption',''),(88,'mail_domain',''),(89,'mail_secret',''),(90,'mail_from_name',''),(91,'peak_percentage','5'),(92,'waiting_percentage','10'),(93,'sos_number','999'),(94,'contact_number','999'),(95,'contact_email','contact@aapbd.com');
